import React from 'react';
import { Switch, Route, NavLink } from 'react-router-dom';
import PersonnelPage from './PersonnelPage'; // Personel sayfası bileşeni
import SharedPage from './SharedPage'; // Paylaşılan sayfası bileşeni

const HomePage = () => {
    return (
        <div>
            <h2>Home Page</h2>
            <nav>
                <ul>
                    <li>
                        <NavLink to="/home/personnel" activeClassName="active">
                            Personnel
                        </NavLink>
                    </li>
                    <li>
                        <NavLink to="/home/shared" activeClassName="active">
                            Shared
                        </NavLink>
                    </li>
                </ul>
            </nav>
            <Switch>
                <Route path="/home/personnel" component={PersonnelPage} />
                <Route path="/home/shared" component={SharedPage} />
            </Switch>
        </div>
    );
};

export default HomePage;
